description:
&lt;p&gt;
Un voyage spatial pour une quête nostalgique des plaisirs laissés sur Terre. 
&lt;br /&gt;
Brigitte Lahaie commandant et femme d&apos;expérience, pilotera ce séjour particulier pour un moment de détente à bord du Vixen69C.
Aucune étape ne sera oubliée! Caresse galactique, fessées étoilées, combinaison argentée aux plaisirs particuliers. 
&lt;br /&gt;
Non! rien ne vous manquera dans l&apos;espace. Laissez vous porter les yeux fermés dans cette Espace solitaire.
&lt;/p&gt;

